import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Map from './Map';
import Slider from './Slider';
import HeroSection from './HeroSection';
import ServiceSection from './ServiceSection';
import AboutUsSection from './AboutUsSection';
import BlogSection from './BlogSection';
import TestimonialsSection from './TestimonialsSection';
import ContactSection from './ContactSection';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import './Home.css';

const Home = () => {
  const [properties, setProperties] = useState([]);
  const [search, setSearch] = useState('');
  const [featuredProperties, setFeaturedProperties] = useState([]);
  const [counties, setCounties] = useState([]);
  const [subcounties, setSubcounties] = useState([]);
  const [region, setRegion] = useState('');
  const [county, setCounty] = useState('');
  const [subcounty, setSubcounty] = useState('');

  // List of Kenya's 8 provinces
  const regions = [
    'Central', 'Coast', 'Eastern', 'Nairobi', 'North Eastern', 'Nyanza', 'Rift Valley', 'Western'
  ];

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        let url = 'http://localhost:5000/properties';

        if (region) {
          url += `?region=${region}`;
          if (county) {
            url += `&county=${county}`;
            if (subcounty) {
              url += `&subcounty=${subcounty}`;
            }
          }
        }

        const response = await axios.get(url);
        setProperties(response.data);
      } catch (error) {
        console.error('Error fetching properties:', error);
      }
    };

    const fetchCounties = async () => {
      try {
        const response = await axios.get('http://localhost:5000/counties');
        setCounties(response.data);
      } catch (error) {
        console.error('Error fetching counties:', error);
      }
    };

    const fetchSubcounties = async () => {
      try {
        const response = await axios.get('http://localhost:5000/subcounties');
        setSubcounties(response.data);
      } catch (error) {
        console.error('Error fetching subcounties:', error);
      }
    };

    fetchProperties();
    fetchCounties();
    fetchSubcounties();
  }, [region, county, subcounty]);

  const handleSearchClick = () => {
    fetchProperties();
  };

  const handleRegionChange = (e) => {
    setRegion(e.target.value);
    setCounty('');
    setSubcounty('');
  };

  const handleCountyChange = (e) => {
    setCounty(e.target.value);
    setSubcounty('');
  };

  const handleSubcountyChange = (e) => {
    setSubcounty(e.target.value);
  };

  const filteredProperties = properties.filter((property) =>
    property.title.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="container">
      <div className="search-container">
        <div className="filters">
          <label htmlFor="region">Region (Province):</label>
          <select id="region" value={region} onChange={handleRegionChange}>
            <option value="">Select Region</option>
            {regions.map((region) => (
              <option key={region} value={region}>{region}</option>
            ))}
          </select>

          <label htmlFor="county">County:</label>
          <select id="county" value={county} onChange={handleCountyChange}>
            <option value="">Select County</option>
            {counties
              .filter((c) => c.region === region)  // Filter counties based on the selected region
              .map((county) => (
                <option key={county._id} value={county.name}>{county.name}</option>
              ))}
          </select>

          <label htmlFor="subcounty">Subcounty:</label>
          <select id="subcounty" value={subcounty} onChange={handleSubcountyChange}>
            <option value="">Select Subcounty</option>
            {subcounties
              .filter((sc) => sc.county === county)  // Filter subcounties based on the selected county
              .map((subcounty) => (
                <option key={subcounty._id} value={subcounty.name}>{subcounty.name}</option>
              ))}
          </select>
        </div>

        <div className="search-bar">
          <input
            type="text"
            placeholder="Search properties..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
          />
          <button onClick={handleSearchClick} className="search-button">
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </div>
      </div>

      <Map properties={filteredProperties} />

      <h2>Featured Rentals</h2>
      <Slider properties={featuredProperties} />

      <HeroSection />
      <ServiceSection />
      <AboutUsSection />
      <BlogSection />
      <TestimonialsSection />
      <ContactSection />
    </div>
  );
};

export default Home;
